  return (
    <Grid container 
    sx={{backgroundColor:'lightblue'}}>
        <Grid item xs={12} md={6}>

        </Grid>
        <Grid item xs={12} md={6} sx={{alignItems:'center'}}>
        <img
                  src={banner1}
                  alt={banner1}
                  style={{ width: '50%', height:  '50%'  }}  // Adjust image height for tablet
                />
            </Grid>

    </Grid>
  )
}

export default About
